import React from "react";
import { useForm } from "react-hook-form";

function CVForm({ onSubmit }) {
  const { register, handleSubmit } = useForm();

  const onFormSubmit = (data) => {
    // Denne funksjonen kalles når skjemaet blir sendt
    onSubmit(data); // sender data til foreldrek komponent (f.eks. Dashboard)
  };

  return (
    <form
      onSubmit={handleSubmit(onFormSubmit)}
      className="p-6 bg-white rounded-lg shadow-md"
    >
      <h2 className="mb-4 text-2xl font-semibold">
        Legg til personlig informasjon
      </h2>

      <label className="block mb-2 text-sm font-semibold">Navn</label>
      <input
        type="text"
        {...register("name", { required: true })}
        className="w-full p-3 mb-4 border-2 border-gray-300 rounded-md"
      />

      <label className="block mb-2 text-sm font-semibold">E-post</label>
      <input
        type="email"
        {...register("email", { required: true })}
        className="w-full p-3 mb-4 border-2 border-gray-300 rounded-md"
      />

      <label className="block mb-2 text-sm font-semibold">Telefonnummer</label>
      <input
        type="text"
        {...register("phone", { required: true })}
        className="w-full p-3 mb-4 border-2 border-gray-300 rounded-md"
      />

      <button
        type="submit"
        className="w-full p-3 text-white bg-blue-500 rounded-md hover:bg-blue-600"
      >
        Lagre personlig informasjon
      </button>
    </form>
  );
}

export default CVForm;
